  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Squaw
  Creek National Wildlife Refuge summarizes refuge activities during the 2008 fiscal
  year. The report begins with and introduction to the refuge and a summary of the
  year's highlights and climatic conditions. Information about monitoring and studies-
  including surveys and census, and studies and investigations - is provided next.
  Habitat restoration and management projects are also covered; activities include
  wetland restoration: on-refuge and wetland restoration: off refuge, upland restoration:
  on-refuge and upland restoration: off-refuge, deepwater/riverine restoration: on-refuge
  and deepwater/riverine: off-refuge, manage water levels, manage moist soil units,
  graze/mow/hay, farming, forest cutting, fire management and pest plant control.
  Fish and wildlife management is discussed next with emphasis on bird banding, disease
  monitoring, reintroductions, nest structures, and predator and exotic control. Coordination
  activities, such as interagency coordination, tribal coordination, private land
  activities, oil and gas activities, and cooperative/friends organizations. The resource
  protection section provides information about law enforcement, permits and economic
  use management, wildfire preparedness, contaminant investigation and cleanup, manage
  water rights, manage cultural resources and land acquisition support. Information
  about public education and recreation is given including provide visitor services,
  and outreach. Finally, refuge planning and administration is discussed.\",\n\t\"owner_org\":
